import VueRouter from 'vue-router';
import login from '../components/Login';
import index from '../components/Index';

const routes = [
    {
        path:'',
        name:'login',
        comment:login
    },
    {
        path:'/index',
        name:'index',
        component:index
    }
];

const router = new VueRouter({
    mode:'history',
    routes
});

export default router;
